import React from 'react';
import UpcomingBills from '../UpcomingBills/UpcomingBills.js';
import AccountList from '../Accounts/AccountList.js';

const SideBar = (props) => {

	const handelLoadAccount = (account_id) => {
		props.onChange(account_id)
	}

	const createNewAccount = () => {
			fetch(props.host+'/newaccount', {
			method: 'post',
			headers: {'Content-Type': 'application/json'},
			body: JSON.stringify({
			    "account_name": "Dort",
			    "account_type": "Savings",
			    "user_id": "7dd568ec-8032-479d-b694-8961cdc0e20e"
			})
		})
			.then(response => response.json())
			.catch(console.log)
	}

	return (
		<div >
			<h3>Actions</h3>
			<button onClick={() => createNewAccount()}>New Account</button>
			<AccountList user_id={props.user_id} host={props.host} onChange={handelLoadAccount}/>
		</div>
	);
};

export default SideBar;
